{"query":"
    query AssetFallbackByArtworkIds($artworkIds: [uuid!]!) {
  asset(where: {artwork: {id: {_in: $artworkIds}}, quality: {_eq: "FALLBACK"}}) {
    ...AssetFragment
    artwork {
      id
    }
  }
}

    fragment AssetFragment on asset {
  id
  publicUrl
  quality
  contractAddress
  tokenId
  mimeType
}
